import React, { Fragment } from "react";
import './App.css';
import Banner from './banner';
import Tableau from './tableau';
import Ajout from './add';
import Modal from './modal';
import { BrowserRouter as Router, Routes, Link, Switch } from "react-router-dom";

function App() {
  return (
    <>
      <div>
            <Routes>
              <Route path="/" exact component={Home} />
              <Route path="/liste" component={Liste} />
              <Route path="/add" component={Add} />
              <Route path="/voir/:name" component={Voir} />
            </Routes>
      </div>
    </>




  );

}

const Home = () => {
  return <h2>Home</h2>;
};

const Liste = () => {
  return (
    <div>
      <Tableau></Tableau>
    </div>
  );

};

const Add = () => {
  return (
    <div>
      <Ajout></Ajout>
    </div>
  );
};

const Voir = ({
  match: {
    params: {name},
  },
}
) => {
  return (
    <div>
      <Tableau></Tableau>
      <Modal name={name}/>
    </div>
  );
};

export default App;
